script: |
  export SUPER_DB_LAKE=test
  super db init -q
  super db create -q test
  super db use -q test
  for i in {1..10}; do
    seq 200 | super -c '{ts:this}' - | super db load -q -
  done
  super db manage -q
  super db query -z 'from test@main:objects | drop id'

outputs:
  - name: stdout
    data: |
      {min:1,max:200,count:2000(uint64),size:1035}
